import React from 'react';
import './Hero.css';

const Hero = () => {
    return (
        <section className="hero">
            <img src="https://lp-cms-production.imgix.net/2019-06/0f58350048b1b544393b5651242e7eb5-shah-faisal-mosque.jpg?w=1920&h=640&fit=crop&crop=faces%2Cedges&auto=format&q=75" alt="Islamabad" />
            <div className="hero-text">
                <h2>Welcome to Islamabad</h2>
                <p>Explore the serene capital of Pakistan, nestled in the foothills of the Himalayas.</p>
            </div>
        </section>
    );
};

export default Hero;
